'use strict';

/*
* When adding names to the namespace, ensure that they are added in alphabetical order according to alias (namespace key).
*/

var ns = [];

ns.push({
	'alias': 'zip',
	'path': '@stdlib/utils/zip',
	'value': require( '@stdlib/utils/zip' ),
	'type': 'Function',
	'related': [
		'@stdlib/utils/unzip'
	]
});

ns.push({
	'alias': 'ztest',
	'path': '@stdlib/math/stats/ztest',
	'value': require( '@stdlib/math/stats/ztest' ),
	'type': 'Function',
	'related': [
		'@stdlib/math/stats/ztest2'
	]
});

ns.push({
	'alias': 'ztest2',
	'path': '@stdlib/math/stats/ztest2',
	'value': require( '@stdlib/math/stats/ztest2' ),
	'type': 'Function',
	'related': [
		'@stdlib/math/stats/ztest'
	]
});


// EXPORTS //

module.exports = ns;
